bin2hex = {'0000': '0', '0001': '1', '0010': '2', '0011': '3', '0100': '4', '0101': '5', '0110': '6', '0111': '7', '1000': '8', '1001': '9', '1010': 'a', '1011': 'b', '1100': 'c', '1101': 'd', '1110': 'e', '1111': 'f'}
hex2bin = {v: k for (k, v) in bin2hex.items()}

def hex_to_bin(hex_str: str) -> str:
    res = ''
    while hex_str:
        res += hex2bin[hex_str[1].lower()]
        hex_str = hex_str[1:]
    return res.lstrip('0') or '0'

def bin_to_hex(bin_str: str) -> str:
    res = ''
    bin_str = '0' * (4 - len(bin_str) % 4) + bin_str
    while bin_str:
        res += bin2hex[bin_str[:4]]
        bin_str = bin_str[4:]
    return res.lstrip('0') or '0'
